var title_f33_42_34476="Oral antibiotics used in exit-site and tunnel infection";
var content_f33_42_34476=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F67277&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F67277&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing (adult) of oral antibiotics used in peritoneal catheter exit-site and tunnel infections",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Amoxicillin",
"       </td>",
"       <td>",
"        250 to 500 mg two times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cephalexin",
"       </td>",
"       <td>",
"        500 mg two to three times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ciprofloxacin*",
"       </td>",
"       <td>",
"        250 mg two times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clarithromycin",
"       </td>",
"       <td>",
"        500 mg loading dose, then 250 mg once or two times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dicloxacillin",
"       </td>",
"       <td>",
"        500 mg four times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Erythromycin",
"       </td>",
"       <td>",
"        500 mg four times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Flucloxacillin (or cloxacillin)",
"       </td>",
"       <td>",
"        500 mg four times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluconazole",
"       </td>",
"       <td>",
"        200 mg once per day for 2 days, then 100 mg once per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Flucytosine",
"       </td>",
"       <td>",
"        0.5-1 g/day titrated to response and serum trough levels (25-50 &micro;g/mL)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Isoniazid",
"       </td>",
"       <td>",
"        200-300 mg once per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Linezolid",
"       </td>",
"       <td>",
"        400-600 mg two times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metronidazole",
"       </td>",
"       <td>",
"        400 mg three times per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moxifloxacin*",
"       </td>",
"       <td>",
"        400 mg once per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ofloxacin*",
"       </td>",
"       <td>",
"        400 mg first day, then 200 mg once per day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pyrazinamide",
"       </td>",
"       <td>",
"        25-35 mg/kg up to 3 g per dose three times per week",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rifampin (rifampicin)&bull;",
"       </td>",
"       <td>",
"        <p>",
"         Patients weighing less than 50 kg: 450 mg once per day",
"        </p>",
"        <p>",
"         Patients weighing greater than or equal to 50 kg: 600 mg once per day",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Trimethoprim-sulfamethoxazole (co-trimoxazole)",
"       </td>",
"       <td>",
"        80-400 mg (one single strength tablet) once per day",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Slowly resolving or recurrent Pseudomonas exit site infections should be treated with a second antipseudomonal drug. See text.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Rifampin (rifampicin) is reserved for combination treatment with an oral penicillin or first generation cephalosporin for slowly resolving and severe S. aureus exit site infections. Due to rapid emergence of resistance, rifampin is not appropriate for use as a single agent.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Li, PK, Szeto, CC, Piraino, B, et al. Peritoneal Dialysis-Related Infections Recommendations: 2010 Update. Perit Dial Int 2010; 30:393. Published in Peritoneal Dialysis International. Copyright &copy; 2010.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
